import React, { Component } from 'react'
import axios from 'axios'
export default class App extends Component {
  state={
    quests: []
  }
  componentDidMount(){
    axios.get('http://localhost:8080/quests')
    .then(
      res => this.setState({quests: res.data._embedded.questList},
      console.log(res.data._embedded.questList)
      ))
  }
  test = () =>{
    if(this.state.quests.length > 0) return this.state.quests[0].name
  }
  render() {
    return (
      <div>
          {test()}
      </div>
    )
  }
}
